import React, { useState } from "react";

function Products() {
  const [products] = useState([
    {
      id: 1,
      name: "handbag1",
      price: 300,
      image: buckle - fashion,
      status: "hot",
    },
    {
      id: 1,
      name: "handbag2",
      price: 200,
      image: floral - sling,
      status: "hot",
    },
    { id: 1, name: "handbag3", price: 100, image: sling - bag, status: "hot" },
    {
      id: 1,
      name: "handbag4",
      price: 250,
      image: knitted - bag,
      status: "hot",
    },
    { id: 1, name: "handbag5", price: 300, image: pink - bag, status: "hot" },
    {
      id: 1,
      name: "handbag6",
      price: 450,
      image: Red - handbag,
      status: "hot",
    },
    {
      id: 1,
      name: "handbag7",
      price: 470,
      image: shoulder - bag,
      status: "hot",
    },
    {
      id: 1,
      name: "handbag8",
      price: 500,
      image: teal - n - pink,
      status: "hot",
    },
    {
      id: 1,
      name: "handbag9",
      price: 400,
      image: woven - sling,
      status: "hot",
    },
    {
      id: 1,
      name: "handbag10",
      price: 600,
      image: yellow - backpack,
      status: "hot",
    },
  ]);
  return <div>{{ Products: [...products] }}</div>;
}

export default Products;
